  \"2013-03-14T15:10:28.269095\",\n\t\"name\": \"ozark-national-forest-special-intrest-area-polygon\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This layer is the Ozark-St. Francis National
  Forest Special Interest Area polygons. The Ozark - St. Francis National Forests
  have 21 Special Interest Areas (SIA) totaling approximately 23,243 acres. SIAs are
  managed for their unique goelogical, botanical, biological, zoological, scenic,
  or cultural features. These features are unique enough that they ae not found in
  loarge areas anywhere on the Forests, or they provide the best representation of
  similar areas on the Forests. These areas are designated as SIAs because of their
  unique features, complexity, and degree of interest. They are managed for their
  unique recreational and educational values, and are intended for public use and
  interpretation.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
